Здравствуйте! Меня зовут Станислав, я являюсь собственником и руководителем интернет-агентства «аАкцент»
Бизнесом в сфере интернет-маркетинга я занимаюсь с 2006 года. За это время моё агентство занималось как сайтами-визитками, так и сложными web-проектами, но я понимал, что-то     мы делаем не так. Сайты-визитки сами по себе не несли ценности предпринимателям, а дорогие проекты нужны были заказчикам не для реального развития бизнеса и увеличения продаж, а в качестве игрушки.
В то же время к нам всё чаще обращались предприниматели, маркетологи с полупустыми и недоделанными сайтами. Часто там не было того, что им обещали предыдущие разработчики и seo-специалисты. Часто у клиентов не было даже доступов к своему сайту и домену, сроки продления имени сайта подходили, а продлить было невозможно. Часто система управления сайтом была сломана и работала не так, как должна, а если и работала корректно, то клиент не знал, что она есть, и что он самостоятельно может вносить в неё изменения.
Вывод: IT-компании работают, ориентируясь на себя и свои (непонятные обычному человеку) услуги, и совершенно не понимают и не слышат своих клиентов.
А клиенту в итоге необходимо:
* понимание того, что и с какой целью делает агентство;
* удобный и доделанный сайт с приличным дизайном, работающие формы заказа и обратного звонка;
* настроенные системы аналитики и обязательно — расшифровка и пояснение показателей;
* наличие доступов к сайту, доменному имени и хостингу (на всякий случай);
* периодические правки и доработки сайта, размещение акций, фото, товаров и т.д.; 
* повышение позиций сайта в поисковых системах, посещаемость сайта и, как следствие, увеличение продаж;
* клиенту нужна помощь и советы специалистов и интернет-маркетологов по развитию бизнеса и выбору новых рекламных направлений.
Ему просто хочется, чтобы с ним разговаривали на одном языке и не матерились словами: Апдейт, CTR, CPC…
Я решил построить интернет-агентство с другим видением и подходом к сервису и работе с клиентами.
Мы разработали новые услуги с учетом всех вышеописанных проблем. Когда к нам на продвижение приходит новый клиент, мы дорабатываем сайт и дизайн, донаполняем, правим верстку сайта, устанавливаем дополнительные формы и сервисы, рисуем новые изображения для слайдов и банеров, пишем тексты, наполняем пустые страницы сайта…
Другими словами, мы доводим сайт до законченного вида и не берем за это дополнительных денег. Мы самостоятельно связываемся с предыдущими разработчиками или seo-специалистами, добиваемся всех доступов и, при необходимости, курируем процесс передачи прав собственности нашему клиенту. Продвигаем и развиваем сайт, выводим его на высокие позиции в поисковой выдаче. Обучаем представителей клиента работе с Яндекс.Метрикой и системой управления сайтом. Учим наполнять фотогалерею, проекты и менять цены.
Думаем вместе с клиентом в какую сторону и как развивать его бизнес, что еще нового можно сделать для того, чтобы наш клиент всегда был на шаг впереди своих конкурентов. Наши проект-менеджеры всегда разговаривают на языке, понятном для обычного человека.
